Normalno: uniMMR > 2, trgovanje normalno;

Nizko tveganje: 1,5 < uniMMR <= 2, normalno trgovanje, vendar morate biti pozorni na morebitno likvidacijo;

Srednje tveganje: 1,2 < uniMMR <= 1,5, normalno trgovanje, vendar morate dodati več sredstev, da se izognete likvidaciji;

Visoko tveganje: 1,1 < uniMMR <= 1,2, omejeno trgovanje, ni mogoče trgovati, dvigovati in lahko izvedete samo pojemajoče trgovanje;

Likvidirano: 1 < uniMMR <= 1,05 %, likvidacija se sproži.

V stečaju: uniMMR <= 1, v stečaju."

